
create table accounts (id bigint generated by default as identity, oid varchar(30) not null, created_by varchar(255), created_date date, last_mod_by varchar(255), last_mod_date date, primary key (id));
create table adresse_externe (id bigint generated by default as identity, oid varchar(30) not null, adr_hausnummer varchar(70), adr_plz integer, adr_stadt varchar(20), adr_str varchar(70), mandant VARCHAR(20), primary key (id));
create table adresse_interne (id bigint generated by default as identity, oid varchar(30) not null, adr_hausnummer varchar(70), adr_strasse varchar(70), mandant VARCHAR(20), primary key (id));
create table adresse_reference (id bigint generated by default as identity, oid varchar(30) not null, mandant varchar(20), adr_externe_id bigint, adr_interne_id VARCHAR(20), primary key (id));
create table authoritys (id bigint generated by default as identity, oid varchar(30) not null, created_by varchar(255), created_date date, last_mod_by varchar(255), last_mod_date date, auth_authority varchar(255), primary key (id));
create table authoritys_permissions (authority_id bigint, permission_id bigint, primary key (authority_id, permission_id));
create table buerger (id bigint generated by default as identity, oid varchar(30) not null, buer_geburtsdatum date, buer_nachname varchar(70) not null, buer_vorname varchar(70), mandant varchar(20), primary key (id));
create table buerger_kinder (buerger bigint not null, kinder bigint not null, primary key (buerger, kinder));
create table buerger_partner (buerger bigint not null, partner bigint not null, primary key (buerger, partner));
create table buerger_pass (buerger bigint not null, pass bigint not null, primary key (buerger, pass));
create table buerger_sachbearbeiter (buerger bigint not null, sachbearbeiter bigint not null, primary key (buerger, sachbearbeiter));
create table buerger_staatsangehoerigkeit_references (buerger bigint not null, staatsangehoerigkeit_references bigint not null, primary key (buerger, staatsangehoerigkeit_references));
create table buerger_wohnungen (buerger bigint not null, wohnungen bigint not null, primary key (buerger, wohnungen));
create table company_base_infos (id bigint generated by default as identity, oid varchar(30) not null, created_by varchar(255), created_date date, last_mod_by varchar(255), last_mod_date date, comp_adress varchar(255), comp_name varchar(255), primary key (id));
create table company_base_infos_accounts (company_base_infos bigint not null, accounts bigint not null, primary key (company_base_infos, accounts));
create table pass (id bigint generated by default as identity, oid varchar(30) not null, pass_typ varchar(10), pass_augenfarbe varchar(70), pass_austellungsdatum date, pass_behoerde varchar(70), pass_groesse varchar(20), pass_gueltig_bis date, pass_kode varchar(10), pass_passnummer varchar(70), mandant varchar(20), staatsangehoerigkeit_reference bigint, primary key (id));
create table permissions (id bigint generated by default as identity, oid varchar(30) not null, created_by varchar(255), created_date date, last_mod_by varchar(255), last_mod_date date, perm_permission varchar(255), primary key (id));
create table revinfo (rev integer generated by default as identity, revtstmp bigint, primary key (rev));
create table staatsangehoerigkeit_reference (id bigint generated by default as identity, ref_oid varchar(100) not null, mandant varchar(20), primary key (id));
create table users (id bigint generated by default as identity, user_birthdate date, created_by varchar(255), created_date date, user_email varchar(255), user_enabled boolean, user_forname varchar(255), last_mod_by varchar(255), last_mod_date date, oid varchar(30) not null, user_password varchar(255), user_surname varchar(255), user_username varchar(255) not null, mandant varchar(20), primary key (id));
create table users_accounts (users bigint not null, accounts bigint not null, primary key (users, accounts));
create table users_authoritys (user_id bigint, authority_id bigint, primary key (authority_id, user_id));
create table wohnungen (id bigint generated by default as identity, oid varchar(30) not null, wohn_ausrichtung varchar(20), wohn_stock varchar(255), mandant varchar(20), adresse_id bigint, primary key (id));
create table sachbearbeiter (id bigint generated by default as identity, oid varchar(30) not null,sach_funktion varchar(50), sach_fax varchar(50),sach_telephone varchar(50), sach_organisationseinheit varchar(50),user_id bigint, mandant varchar(20), primary key (id));
create table sachbearbeiter_buerger (sachbearbeiter bigint not null, buerger bigint not null, primary key ( sachbearbeiter,buerger));
